import React, { useEffect } from 'react'
import Navbar from '../../components/navbar/Navbar'
import './Dorms.css';
import { useSelector, useDispatch } from 'react-redux'
import { useNavigate, useParams } from "react-router-dom";
import { getDormById } from '../../actions/dorms';

function Dorms() {
  const navigate = useNavigate();
  const dispatch = useDispatch()
  let { id } = useParams();
  console.log(id)


  const Dorm = useSelector((state) => state.dorm)
  console.log(Dorm)

  useEffect(() => {
    dispatch(getDormById(id));
  }, [dispatch]);
  return (

    <div>
      <Navbar />
      <center>
        <h1>ボールを食べる</h1>
        <h2>INSANELY COOL DORM CHIEF</h2>
        <p>Plan:</p>
        <ul>
          <li>Dorm info (photo rating...) on the left</li>
          <li>Reviews of the dorm on the right</li>
          Get dorm from id that is in the url
        </ul>

      </center>
      <center><iframe className='waw' width="110" height="200" src="https://www.myinstants.com/instant/bruh/embed/" frameborder="0" scrolling="no"></iframe></center>
    </div>
  )
}
export default Dorms
